VALUES ('3529670501633', 'Blanquette de veau aux girolles', 'Sauté de veau assaisonné (sauté de veau 47%, eau, se épaississant: amidon modifié (E1422), sucre, poivre), sauce (eay, creme fraiche, fond blanc de volaille [sirop de glucose, sel, farine de ble, poule (graisse de poule, viande de poule), arome, oignon, extrait de poireau et de céleri, extraits d\'épices et de plantes aromatiques) épaississant: amidon modifié (E1422), arômes, exhausteurs de goût: glutamate monosodique et inosinate disodique (dérivé de blé et de soja), sel, poivre), girolles saumurées [girolles 2,3 %, eau, sel, acidifiant: adide citrique), oignons émincés préfrits (oignons, huile de tournesol). Pourcentages à la mise en ceuvre exprimés sur le poids net total.', 'https://static.openfoodfacts.org/images/products/352/967/050/1633/front_fr.5.400.jpg', '8', '3.3', '3.3', '1.8', '', '10', '1.3', '0.511811023622047', '', '0');

